import React from "react";
import "./styles.scss";

export function Footer() {
  return (
    <div className="footer">
      <div className="get-started">
        <p className="get-started-title">{"Get started  now"}</p>
        <div>
          <input type="text" placeholder="email address" />
          <button>Submit</button>
        </div>
      </div>
    </div>
  );
}
